import React from "react";

const GettingthecodeIMGPage = () => {
  return (
    <>
      <div
        className="bg-cover bg-no-repeat bg-white-A700 h-[1727px] mx-auto w-full"
        style={{ backgroundImage: "url('images/img_gettingthecode.png')" }}
      ></div>
    </>
  );
};

export default GettingthecodeIMGPage;
